import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { Feedback } from 'src/app/model/feedback';
import { FeedbackService } from 'src/app/service/feedback.service';

@Component({
  selector: 'app-create-feedback',
  templateUrl: './create-feedback.component.html',
  styleUrls: ['./create-feedback.component.css']
})
export class CreateFeedbackComponent implements OnInit {

  feedback: Feedback = new Feedback();

  constructor(private feedbackService: FeedbackService, private router: Router) { }

  ngOnInit(): void {
  }

  saveFeedback(){
    this.feedbackService.createFeedback(this.feedback).subscribe(data=>{
      console.log(data);
      this.goToFeedbackList();
    }, error => console.log(error));
  }

  goToFeedbackList(){
    this.router.navigate(['/landing-page/feedback-list']);
  }

}

<div class="col-md-6 offset-md-3 " style="margin-bottom: 100px;">
  <hr><br>
  <h3 class="text-center"><u>Create Feedback</u></h3>
  <form (ngSubmit) = "saveFeedback()" >

    <div class="form-group">
      <label>Feedback Id</label>
      <input type="text" class="form-control" id="feedbackId"
        [(ngModel)] = "feedback.feedbackId" name="feedbackId">
    </div>
    <div class="form-group">
      <label>Rating</label>
      <input type="text" class="form-control" id="rating"
        [(ngModel)] = "feedback.rating" name="rating">
    </div>

    <div class="form-group">
      <label>Patient Id</label>
      <input type="text" class="form-control" id="patientId"
        [(ngModel)] = "feedback.patient.patientId" name="patientId">
    </div>
    <div class="form-group">
      <label>Doctor Id</label>
      <input type="text" class="form-control" id="doctorId"
        [(ngModel)] = "feedback.doctor.doctorId" name="doctorId">
    </div>
    <div class="form-group">
      <label>Feedback Comment</label>
      <input type="text" class="form-control" id="feedbackComment"
        [(ngModel)] = "feedback.feedbackComment" name="feedbackComment">
    </div>

    <div class="text-center">
      <button class="btn btn-success " type="submit">Submit</button>
    </div>
</form>
</div>
